import React from 'react'
import {motion} from 'framer-motion'

const Descriptions = () => {
  return (
    <div>
    <div>Descriptions</div>

      <motion.img
      width={'15%'}
      src='/img/ok.png'
      alt=''

      //анимация
      animate={{rotate:360}}
      transition={{
        delay:1,
        duration:2,
        repeat: Infinity,
        repeatDelay: 0.5,
        type: 'inertia',  
      }}
      />

      <motion.p
      initial={{
        x:-1000,
        opacity:0
      }}

      animate={{
        x:500,
        opacity: 1
      }}
    >
      Заказывай скорее
    </motion.p>
    </div>
  )
}

export default Descriptions
